INSERT INTO `news` (`id`, `newsTitle`, `newsContent`, `featureImage`, `categories`, `status`, `datePublished`, `dateSaved`) VALUES
(1, 'BRGY. Aurelio Website', '<p>We are thrilled to announce that our <strong>new website</strong> is officially live and accessible to all citizens! 🎉</p><p>Our updated website brings a fresh look and feel, designed with YOU in mind. It’s now easier than ever to navigate, find important information, and connect with us.<br><br></p><h4><strong>New Features and Improvements:</strong></h4><ul><li><strong>Simplified Navigation:</strong> We’ve reorganized the layout to make it more user-friendly and intuitive, so you can quickly find what you’re looking for.</li><li><strong>Improved Design:</strong> A modern, clean look that makes browsing on any device smooth and enjoyable.</li><li><strong>Easier Communication:</strong> We’ve made it simpler for you to submit your <strong>concerns, feedback, or inquiries</strong> through a streamlined online form.</li></ul><h4><strong>Have a Concern or Question?</strong></h4><p>Your voice matters! With our <strong>new contact page</strong>, submitting your concerns or asking questions has never been easier. Simply visit the <strong>Contact Us</strong> section of the site, fill out the quick form, and we’ll get back to you as soon as possible.</p><p>We value your feedback and look forward to hearing from you. Whether it’s a suggestion, issue, or just a general inquiry, we’re here to help.</p><p>🔗 <strong>Visit the new website now:</strong> <a href=\"https://brgyaurelio.online/\" target=\"_blank\">[https://brgyaurelio.online/]</a></p><p>We hope you enjoy the enhanced experience and look forward to connecting with you through our new site!</p><p>Thank you for your continued support.</p>', 'brgy.-aurelio-website.png', '|Opportunities||Assistance|', 2, '0000-00-00 00:00:00', '2024-11-22 08:15:52'),
(2, 'Tupad', '<p><font color=\"#000000\"><span style=\"font-family: &quot;Placeholder Font&quot;, &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space-collapse: preserve;\">PAHIBALO</span><span class=\"html-span xexx8yu x4uap5 x18d9i69 xkhd6sd x1hl2dhg x16tdsg8 x1vvkbs x3nfvp2 x1j61x8r x1fcty0u xdj266r xat24cr xgzva0m xhhsvwb xxymvpz xlup9mm x1kky2od\" style=\"overflow-wrap: break-word; padding: 0px; margin: 0px 1px; display: inline-flex; vertical-align: middle; width: 16px; height: 16px; font-family: &quot;Placeholder Font&quot;, &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space-collapse: preserve;\"><img height=\"16\" width=\"16\" alt=\"📢\" class=\"xz74otr\" referrerpolicy=\"origin-when-cross-origin\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t39/1/16/1f4e2.png\" style=\"border: 0px; object-fit: fill;\"></span><span class=\"html-span xexx8yu x4uap5 x18d9i69 xkhd6sd x1hl2dhg x16tdsg8 x1vvkbs x3nfvp2 x1j61x8r x1fcty0u xdj266r xat24cr xgzva0m xhhsvwb xxymvpz xlup9mm x1kky2od\" style=\"overflow-wrap: break-word; padding: 0px; margin: 0px 1px; display: inline-flex; vertical-align: middle; width: 16px; height: 16px; font-family: &quot;Placeholder Font&quot;, &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space-collapse: preserve;\"><img height=\"16\" width=\"16\" alt=\"📢\" class=\"xz74otr\" referrerpolicy=\"origin-when-cross-origin\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t39/1/16/1f4e2.png\" style=\"border: 0px; object-fit: fill;\"></span><span class=\"html-span xexx8yu x4uap5 x18d9i69 xkhd6sd x1hl2dhg x16tdsg8 x1vvkbs x3nfvp2 x1j61x8r x1fcty0u xdj266r xat24cr xgzva0m xhhsvwb xxymvpz xlup9mm x1kky2od\" style=\"overflow-wrap: break-word; padding: 0px; margin: 0px 1px; display: inline-flex; vertical-align: middle; width: 16px; height: 16px; font-family: &quot;Placehol