(1, 'Illegal throwing of Garbage', 'the act of improperly disposing of waste in public spaces, such as streets, parks, or waterways, rather than using designated trash bins or recycling facilities. This practice contributes to environmental pollution, harms wildlife, and creates public health hazards. It is considered a violation of environmental laws and often results in fines or other penalties to encourage proper waste management and keep communities clean.', 3, 500, '12 Hours Community Service'),
(4, 'Illegal Parking or Obstruction of Public Roads', 'Parking vehicles or placing obstructions (e.g., stalls, debris) on streets or sidewalks, impeding pedestrian or vehicular traffic.\r\n\r\nLegal Basis: Local traffic and road use ordinances.\r\n\r\nPenalty: Fines, towing of vehicles, or removal of obstructions.', 1, 1500, ''),
(5, 'Loitering During Curfew Hours', 'Being outdoors during curfew hours without valid reason, particularly for minors or in areas with specific restrictions.\r\n\r\nLegal Basis: Local curfew ordinances or laws, such as for minors under the Juvenile Justice and Welfare Act (RA 9344).\r\n\r\nPenalty: Temporary detainment, warning, or required presence of a parent/guardian for minors.', 2, 0, '12 Hours Community Service'),
(7, 'Waste Disposals', 'asdf sdgd fasdf adasda sdas das', 1, 600, '');

