(1, 'Mission:<br /><br />\nTo become the center of holiness of San Jose, Dinagat Islands leader in socio-economic cooperation with proactive and empowered , constituents, propelled and enlightened leaders for sustainable growth and development under the guidance of devine providence.<br /><br />\n<br /><br />\nVision:<br /><br />\nBarangay is the major manufacture of fashion accessories in caraga region here people line in a happy environment with active participants in barangay governance.', '<p style=\"text-align: justify;\" class=\"\"></p><h4 class=\"\" style=\"text-align: justify; \"><font color=\"#000000\" style=\"\"><span style=\"font-family: Helvetica;\">&nbsp; Welcome to the Barangay Aurelio Web-based Management System, your digital gateway to more efficient and accessible community services. Our platform is designed to streamline the administrative processes of Barangay Aurelio, ensuring that residents and officials can manage tasks with ease and convenience.</span></font></h4><h4 class=\"\"><font color=\"#000000\" style=\"\"><span style=\"font-family: Helvetica;\"><br></span></font></h4><h4 class=\"\" style=\"text-align: justify; \"><font color=\"#000000\" style=\"\"><span style=\"font-family: Helvetica;\">&nbsp; With a focus on modernizing local governance, our system offers features such as simplified resident registration, document management, and real-time updates for a more transparent and organized barangay administration.</span></font></h4><h4 class=\"\"><font color=\"#000000\" style=\"\"><span style=\"font-family: Helvetica;\"><br></span></font></h4><p></p><p style=\"text-align: justify;\" class=\"\"></p><h5 class=\"\" style=\"text-align: justify;\"><font color=\"#000000\" style=\"\"><span style=\"font-family: Helvetica;\">&nbsp; At Barangay Aurelio, we are committed to fostering a connected and empowered community by leveraging technology to bridge the gap between traditional practices and the needs of the modern era. This system is a step toward achieving better service delivery, efficient management, and stronger community relationships.</span></font></h5><p></p><div style=\"text-align: justify;\"><font color=\"#000000\" style=\"\"><br><span style=\"font-family: Helvetica;\">Thank you for trusting us to serve you better.</span></font><br></div><div style=\"text-align: justify;\"><span style=\"background-color: var(--bs-card-bg); color: var(--bs-modal-color); font-family: var(--bs-body-font-family); font-size: var(--bs-body-font-size); font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\"><br></span></div><div style=\"text-align: justify;\"><img style=\"width: 266.541px; height: 275.562px;\" src=\"data:image/png;base64,\" data-filename=\"logo.png\" class=\"\"><br></div>', 'https://brgyaurelio.online/', 'Aurelio', 'P-2 Aurelio, San Jose, Dinagat Islands', '09876543210', 'aurelio@aurelio.com.ph', 'Unity in Diversity, Strength in Community', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d1846.4857697666534!2d125.57672271530565!3d10.010161618733278!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3306b7f005d8ae8d%3A0xe87cf0a819a1c12a!2sAurello%20Gym!5e1!3m2!1sen!2sph!4v1729239793370!5m2!1sen!2sph\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'a:6:{i:0;s:7:\"Purok 1\";i:1;s:7:\"Purok 2\";i:2;s:7:\"Purok 3\";i:3;s:7:\"Purok 4\";i:4;s:7:\"Purok 5\";i:5;s:7:\"Purok 6\";}', 'Hon. Lovely Fe B. Bacolod', 'Rossana Y. Taray', 'Lea R. Cabriana', 'Blance Minneth A. Nicolas', 'a:7:{i:0;a:3:{s:4:\"name\";s:24:\"Hon. Julius Ken M. Ecleo\";s:11:\"designation\";s:31:\"Chairman Committee on Education\";s:2:\"id\";s:23:\"6729eb71cc6ae1730800497\";}i:1;a:3:{s:4:\"name\";s:25:\"Cristituto B. Baynosa Jr.\";s:11:\"designation\";s:31:\"Chairman Com. On Infrastructure\";s:2:\"id\";s:23:\"6729f9169a1b91730803990\";}i:2;a:3:{s:4:\"name\";s:18:\"Junrey C. Delmores\";s:11:\"designation\";s:33:\"Chairman 